import React from 'react';
import styled from 'styled-components';
import SearchFilter from './SearchFilter';

function SearchBody() {
	return (
		<ComponentWrapper>
			<div className="search-container">
				<h2 className="search-label">
					연관 직무<span>1</span>
				</h2>
				<div className="category-tag-container">
					<a href="/wdlist/4" className="category-tagitem">
						프론트엔드 개발자
					</a>
				</div>
			</div>
			<div className="search-container">
				<h2 className="search-label">
					포지션 <span>000개</span>
				</h2>
			</div>
			<SearchFilter />
			<li>
				<div data-cy="job-card" className="Card_className__u5rsb">
					<a
						href="/wd/116708"
						className=""
						aria-label="position link"
						data-attribute-id="position__click"
						data-job-category-id="518"
						data-job-category="IT"
						data-company-id="7375"
						data-company-name="샤플앤컴퍼니"
						data-position-id="116708"
						data-position-name="프론트엔드 개발 (2년이상)"
						data-response-level="very_high"
						data-response-rate="100"
						data-ai-score=""
						data-ai-score-status=""
						data-recommend-model-status="notBase"
						data-recommend-model-index="0"
					>
						<header style='background-image: url("https://image.wanted.co.kr/optimize?src=https://static.wanted.co.kr/images/company/7375/3nmmhw5dka7cpxlw__400_400.jpg&amp;w=400&amp;q=75");'>
							<button
								className="bookmarkBtn"
								type="button"
								aria-label="bookmark button"
								data-attribute-id="position__bookmark__click"
								data-job-category-id="518"
								data-job-category="IT"
								data-company-id="7375"
								data-company-name="샤플앤컴퍼니"
								data-position-id="116708"
								data-position-name="프론트엔드 개발 (2년이상)"
								data-kind="add"
							>
								<svg
									width="22"
									height="22"
									viewBox="0 0 18 18"
									fill="none"
									xmlns="https://www.w3.org/2000/svg"
								>
									<path
										fillRule="evenodd"
										clipRule="evenodd"
										d="M3.58065 1C3.25997 1 3 1.26206 3 1.58533V16.4138C3 16.8632 3.48164 17.145 3.86873 16.922L9.00004 13.9662L14.1313 16.922C14.5184 17.145 15 16.8632 15 16.4138V1.58533C15 1.26206 14.74 1 14.4194 1H9.00004H3.58065ZM8.71195 12.7838C8.89046 12.681 9.10961 12.681 9.28812 12.7838L13.8387 15.4052V2.17067H9.00004H4.1613V15.4052L8.71195 12.7838Z"
										fill="white"
									/>
									<path
										d="M9.28812 12.7838C9.10961 12.681 8.89046 12.681 8.71195 12.7838L4.1613 15.4052V2.17067H9.00004H13.8387V15.4052L9.28812 12.7838Z"
										fill="black"
										fillOpacity="0.25"
									/>
								</svg>
							</button>
						</header>
						<div className="body">
							<div className="job-card-position">
								프론트엔드 개발 (2년이상)
							</div>
							<div className="job-card-company-name">
								샤플앤컴퍼니
							</div>
							<div className="Tooltip_container__AvBvM">
								<button
									className="Tooltip_label__P9FMp"
									type="button"
								>
									<div className="ResponseLevelLabel_container__dJphx ResponseLevelLabel_veryHigh__3ArDP">
										<span>응답률 매우 높음</span>
									</div>
									<div className="Tooltip_tooltipContent__6exdr">
										지원 후 응답받을 확률이 95% 이상입니다.
									</div>
								</button>
							</div>
							<div className="job-card-company-location">
								서울<span className="addressDot">.</span>
								<span>한국</span>
							</div>
							<div className="reward">채용보상금 1,000,000원</div>
						</div>
					</a>
				</div>
			</li>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	margin: 60px auto 80px;
	width: 87.72%;
	position: relative;
	max-width: 1060px;
	.search-container {
		padding-bottom: 60px;
	}
	.search-label {
		font-size: 24px;
		font-weight: 600;
		line-height: 36px;
		margin-bottom: 18px;
		color: #333;
		> span {
			margin-left: 10px;
			font-weight: 400;
		}
	}
	.category-tag-container {
		position: relative;
		width: 100%;
		text-align: left;
		.category-tagitem {
			display: inline-block;
			background-color: #fff;
			text-align: center;
			padding: 0 18px;
			height: 40px;
			line-height: 40px;
			border: 1px solid #e1e2e3;
			border-radius: 20px;
			font-size: 16px;
			font-weight: 400;
			color: #333;
			margin: 0 6px 6px 0;
			font-family: inherit;
		}
	}

	/* .CompanyList_className__onSYS {
		margin: -10px;
		position: relative;
		scrollbar-width: none;
	} */
`;

export default SearchBody;
